import SubscribeImage from "../assets/subscribe.jpg";

const Subscribe = () => {
  return (
    <section>
      <img src={SubscribeImage} alt="Subscribe" className="pt-16" />
      <div className="pagecenter">
        <h1 className="title"></h1>
      </div>
    </section>
  );
};

export default Subscribe;
